import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import {BrowserRouter} from "react-router-dom";
import App from "./App";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <React.Fragment>
    <BrowserRouter>
    <App/>
    </BrowserRouter>
    </React.Fragment>
  </React.StrictMode>
);
